import { Left } from './Left'
import { Rigth } from './Rigth'

export const RigthBox = () => {
  return (

    <div class="sideBox mx-3 order-1">
        <div class="d-grid position-relative">
            <Left/>
            <Rigth/>
        </div>
    </div>
  )
}
